INSERT INTO `email` (`id`, `name`, `subject`, `type`, `content`, `alerty`, `status`) VALUES
('registration', 'Registration Completetion', '[#site_name#] Registration Info', 'Register', 'Hello #name#, <br>\r\n<br>\r\nThank you for your registration on our site.<br>\r\n<br>\r\nYour login information:<br>\r\n<br>\r\nLogin: #username#<br>\r\nPassword: ********<br>\r\n<br>\r\nYou can login here: #site_url#<br>\r\n<br>\r\nContact us immediately if you did not authorize this registration.<br>\r\n<br>\r\nThank you.<br>\r\n<br>\r\n#site_url#<br>', 'Registered Successfully', 1),
('confirm_registration', 'Registration Confirmation', '[#site_name#] Confirm your registration', 'Register', 'Hello #name#,\r\n\r\nThank you for registering in our program\r\nPlease confirm your registration or ignore this message.\r\n\r\nCopy and paste this link to your browser:\r\n#site_url#/login?action=confirm&c=#confirm_string#\r\n\r\nThank you.\r\n#site_name#', '', 1),
('forgot_password', 'Password Reminder', 'The password you requested', 'Recover', 'Hello #name#,<br>\n\nSomeone (most likely you) requested your password<br>\nYour password has been changed!!!<br>\n\nYou can log into our account with:<br>\n<br>\nUsername: #username#<br>\nPassword: #password#<br>\n<br>\nWe hope that helps.', 'New Password Requested', 1),
('forgot_password_confirm', 'Password Reminder Confirmation', 'Password request confirmation', 'Recover', 'Hello #name#,<br>\r\n<br>\r\nPlease confirm your request for password reset.<br>\r\n<br>\r\nCopy and paste this link to your browser:<br>\r\n#site_url#/recover?c=#confirm_string#\r\n<br>\r\nThank you.\r\n#site_name#', 'Confirm Password Requested', 1),
('bonus', 'Bonus Notification', 'Bonus Notification', 'Bonus', 'Hello #name#,<br>\r\n<br>\r\nYou received a bonus: #amount# #method#<br>\r\nYou can check your statistics here:<br>\r\n#site_url#<br>\r\n<br>\r\nGood luck.<br>', 'You received a bonus: #amount#', 1),
('penalty', 'Penalty Notification', 'Penalty Notification', 'Bonus', 'Hello #name#,<br>\n<br>\nYour account has been charged for #amount#<br>\nYou can check your statistics here:<br>\n#site_url#<br>\n<br>\nGood luck.<br>', 'Your account has been charged for #amount#', 1),
('change_account', 'Account Change Notification', '[#site_name#] Profile Changed', 'Account', 'Your account data has been changed from ip #ip#<br>\r\n<br>\r\nNew information:<br>\r\n#data#<br>\r\n<br>\r\nContact us immediately if you did not authorize this change<br>', 'Your account data has been changed from ip #ip#', 1),
('withdraw_request_user_notification', 'User Withdrawal Request Notification', '[#site_name#] Withdrawal Requested', 'Withdraw', 'Hello #name#,<br>\r\n\r\n<br>\r\nYou have requested to withdraw #amount# #method#.<br>\r\nWallet: #wallet#<br>\r\nThe requested IP address is #ip#.<br>\r\nThe request date is #date#.<br>\r\n<br>\r\n<br>\r\nThank you.<br>\r\n#site_name#<br>\r\n#site_url#<br>', 'Requested to withdraw #amount# #method#', 1),
('withdraw_request_admin_notification', 'Administrator Withdrawal Request Notification', 'Withdrawal Request has been sent', 'Admin', '#username# requested to withdraw #amount# #method# in #wallet# from IP #ip#.', '', 1),
('withdraw_user_notification', 'User Withdrawal Notification', '[#site_name#] #method# Withdrawal Successful', 'Withdraw', 'Hello #name#.<br>\r\n<br>\r\nYou have successfully withdrawn #amount# #method# from your account. <br>\r\nWithdrawal Wallet: #wallet#<br>\r\nTransaction ID: #batch#.<br>\r\n<br>\r\n#site_name#<br>\r\n#site_url#<br>', '#amount# #method# successfully withdrawn', 1),
('withdraw_admin_notification', 'Administrator Withdrawal Notification', 'Withdrawal has been sent', 'Admin', 'User #username# received #currency# #amount# to #method# account #wallet#. The batch is #batch#.', '#username# received  #amount##method# to wallet #wallet#. Batch is #batch#.', 1),
('deposit_admin_notification', 'Administrator Deposit Notification', 'Account Balance Deposit Processed', 'Admin', 'User #username# deposit #amount# #currency# to account balance.', NULL, 1),
('deposit_user_notification', 'Deposit User Notification', '[#site_name#] #method# Deposit Confirmed ', 'Deposit', 'Dear #name# (#username#)\r\n<br>\r\nWe have successfully received your deposit #amount# #currency# to balance.<br>\r\n<br>\r\nCurrency : #method#<br>\r\nBatch: #batch#.<br>\r\n<br>\r\n<br>\r\nThank you.\r\n#site_name#\r\n#site_url#', '#amount# #method# Deposit Successful', 1),
('exchange_admin_notification', 'Exchange Admin Notification', 'Currency Exchange Processed', 'Admin', 'User #username# has exchanged $#amount_from# #currency_from# to $#amount_to# #currency_to#.', NULL, 0),
('exchange_user_notification', 'Exchange User Notification', '[#site_name#] Currency Exchange Completed', 'Exchange', 'Dear #name# (#username#). <br>\r\n<br>\r\nYou have successfully exchanged #amount_from# #currency_from# to #amount_to# #currency_to#.<br>\r\n<br>\r\nThank you.<br>\r\n#site_name#<br>\r\n#site_url#', 'Exchanged $#amount_from# #currency_from# to $#amount_to# #currency_to#', 1),
('brute_force_activation', 'Account Activation after Brute Force', '[#site_name#]  Your account activation code.', 'Account', 'Someone from IP #ip# has entered a password for your account \"#username#\" incorrectly #max_tries# times. The system locked your account until you activated it.\r\n\r\nClick here to activate your account :\r\n\r\n#site_url#activate&code=#activation_code#', 'Account Activation Code Sent.', 1),
('direct_signup_notification', 'Direct Referral Signup', '[#site_name#] New direct affiliate signup', 'Referral', 'Dear #name# (#username#)<br>\r\n<br>\r\nYou have new direct signup on #site_name#<br>\r\nName: #ref_username#<br>\r\nUsername: #ref_name#<br>\r\nEmail: #ref_email#<br>\r\n<br>\r\nThank you.<br>', 'New direct affiliate signup @#ref_username#', 1),
('referral_commision_notification', 'Referral Comission Notification', '[#site_name#] Referral Commission', 'Referral', 'Dear #name# (#username#),<br>\r\n<br>\r\nYou have received a referral commission of #amount# #method# from the #ref_username# (#ref_name#) investment.\r\n<br>\r\n\r\nThank you.<br>\r\n#site_name#<br>\r\n #site_url# <br>', 'Referral commission of #method# #amount#  from #ref_username# ', 1),
('pending_deposit_admin_notification', 'Deposit Request Admin Notification', 'Deposit Request Notification', 'Admin', 'User #username# save deposit $#amount# of #currency# to #plan#.\n\n#fields#', NULL, 1),
('deposit_approved_admin_notification', 'Deposit Approved Admin Notification', 'Deposit has been approved', 'Admin', 'Deposit has been approved:\n\nUser: #username# (#name#)\nAmount: $#amount# of #currency#\nPlan: #plan#\nDate: #deposit_date#\n#fields#', NULL, 1),
('deposit_approved_user_notification', 'Deposit Approved User Notification', '[#site_name#] Deposit has been approved', 'Deposit', 'Dear #name#\r\n\r\nYour deposit has been approved:\r\n\r\nAmount: $#amount# of #currency#\r\nPlan: #plan#\r\n#fields#', '', 1),
('invest_user_notification', 'Investment User Notification', '[#site_name#] Investment Confirmation', 'Invest', 'Dear #name# (#username#)<br>\r\n<br>\r\nWe have successfully received your investment.<br> \r\nPlan: #plan#<br> \r\nAmount: #amount#<br> \r\nCurrency: #method#<br> \r\nTransaction #batch#<br> \r\nDateTime: #date#<br> \r\n\r\n<br>\r\nThank you.<br>\r\n#site_url#<br>', '#plan# Successfully Activated for #amount# #method#', 1),
('logged_in', 'Logged in Successfully', '[#site_name#] Logged in Successfully', 'Account', 'Hello, #name#.<br>\r\n<br>\r\nYour account is accessed from  #city#, #country#, IP: #ip#.<br>\r\n<br>\r\nAccess time: #time#<br>\r\n<br>\r\nIf you did  not enter your account at this time or you do not recognize the location, immediately change or reset your password.<br>\r\n<br>\r\n#site_name#<br>\r\n#site_url#<br>', 'Logged in from #ip# - #country#', 1),
('deposit_account_admin_notification', 'Administrator Deposit Notification (from account balance)', 'A deposit has been processed', 'Admin', 'User #username# deposit $#amount# #currency# from account balance to #plan#.\n\nAccount: #account#\nBatch: #batch#\nCompound: #compound#%.\nReferrers fee: $#ref_sum#', NULL, 1),
('transfer_from_notification', 'Transfer From Notification', '[#site_name#]  Internal Funds Received From #from_username#', 'Transfer', 'Dear #name# (#username#).\r\n<br>\r\nYou have received #method# #amount# from #from_username#\r\n<br>\r\nThank you.<br>\r\n#site_name#<br>\r\n#site_url#', 'Received #method# #amount# from #from_username#', 1),
('transfer_to_notification', 'Transfer To Notification', '[#site_name#] Funds Transfered to #to_username#', 'Transfer', 'Dear #name# (#username#).\r\n<br>\r\nYou have Successfully Transferred #method# #amount# to #to_username#\r\n<br>\r\nThank you.<br>\r\n#site_name#<br>\r\n#site_url#\r\n', 'Transferred #method# #amount# from #to_username#', 1),
('2fa_disabled_notification', '2FA Disable User Notification', '[#site_name#] 2FA Disabled', 'Security', 'Hello #username#.<br>\r\n<br>\r\nTwo Factor Auth is disabled for your account by your request.<br>\r\n<br>\r\n<br>\r\n#site_name#<br>\r\n#site_url#<br>', '2FA Disabled', 1),
('2fa_enabled_notification', '2FA Enable User Notification', '[#site_name#] 2FA Enabled', 'Security', 'Hello #username#.\r\n\r\nTwo Factor Auth is enabled for your account by your request.\r\n\r\n\r\n#site_name#\r\n#site_url#', '2FA Enabled', 1),
('user_ticket_message', 'User Ticket Notification', '[#site_name#] [Ticket:#code#] #title#', 'Support', 'Hello #username#.<br>\r\n<br>\r\nID: #code#<br>\r\nStatus: #status#<br>\r\nSubject:#title#<br>\r\nMessage:#message#<br>\r\n<br>\r\nYou can view and reply to the ticket at any time at <a href=\'#link#\' target=\'_blank\'>#link#</a><br>\r\n<br>\r\n#site_name#<br>\r\n#site_url#<br>', '', 1),
('admin_ticket_message', 'Admin Ticket Notification', '#username# #status# a Ticket - [ID:#code#] #title# ', 'Admin', '#username# wrote:\r\n\r\n#message#\r\n\r\nYou can view and reply to the ticket at any time at #link#', '', 1),
('admin_login_message', 'Admin Login Notification', 'Admin Logged In', 'Admin', 'Hi, Admin\r\nYou just logged in from this #ip#,#city#,#country#,#os#,#browser#\r\n#useragent#\r\n\r\n#site_name#\r\n#site_url#', '', 1),
('telegram_deposit', 't_deposit', 'Deposit Processed Alert', 'Telegram', 'Deposit\r\nInvestor:  #username#\r\nAmount:  #currency# #amount# in #method#\r\n#plan# #batch# #date#\r\n', NULL, 1),
('telegram_withdraw', 't_withdraw', 'Withdraw Processed Alert', 'Telegram', 'Withdrawal #username# \r\nAmount: #currency# #amount# in #method#\r\nTransaction ID : #batch#\r\n', '', 1),
('user_investment_expired', 'Investement expired of user', '[#site_name#]  #plan# Plan expired', 'Invest', 'Hello #name#,\r\n<br>\r\nYour #invested_amount# #method# invested in #plan# on #invest_date# has been expired.<br>\r\n<br>\r\n#site_name#<br>\r\n#site_url#<br>\r\n\r\n', '#invested_amount# #plan# Expired  ', 1),
('email_code', 'Email Code', '[#site_name#] #action# Verification Code', 'Account', 'Hello #name#, <br>\r\n <br>\r\nThis e-mail contains your verification code, so you can complete a #action#  <br>\r\n<br>\r\nCode : <b>#code#</b> <br>\r\n<br>\r\nThis code will expire in 15 minutes.<br>\r\n<br>\r\nContact us immediately if you did not authorize this #action# code.<br>\r\n<br>\r\n#site_name#<br>\r\n#site_url#<br>', '#action# Verification Code sent.', 1),
('withdraw_auto_user_notification', 'User Auto Withdrawal Notification', '[#site_name#] #method# Auto Withdrawal Successful', 'Withdraw', 'Hello #name#.<br>\r\n<br>\r\nYou have got automatic withdrawal of #amount# #method# from your #site_name# account. <br>\r\nCurrency: #method#<br>\r\nWallet: #wallet#<br>\r\nTransaction: #batch#.<br>\r\n<br>\r\n#site_name#<br>\r\n#site_url#<br>', '#amount# #method# successfully auto withdrawn', 1),
('withdraw_error_admin_notification', 'Administrator Withdrawal Error Notification', 'Withdrawal Error: #error# for ID #id# ', 'Admin', 'Withdraw #id#<br>\r\nError:#error#  <br>\r\nAmount:#amount# <br>\r\n', '', 1),
('invest_admin_notification', 'Administrator Investment Notification ', 'A Investment has been processed', 'Admin', 'User #username# invested #amount# #method#\r\nPlan: #plan#\r\nAmount: #amount#\r\nCurrency: #method#\r\nTransaction #batch#\r\nDateTime: #date#\r\nCompound #compund# ', '', 1),
('user_ticket_reply', 'User Ticket Reply', '[#site_name#]Re: [Ticket:#code#] #title#', 'Support', 'Hello #username#.<br>\r\n<br>\r\n\r\nID: #code#<br>\r\nStatus: #status#<br>\r\nSubject: #title#<br>\r\nReply: #message#<br>\r\n<br>\r\nYou can view and reply to the ticket at any time at <a href=\'#link#\' target=\'_blank\'>#link#</a><br>\r\n<br>\r\n#site_name#<br>\r\n#site_url#<br>', '', 1),
('admin_ticket_reply', 'Admin Ticket Notification', '#status#: #username# [Ticket:#code#] #title#', 'Admin', '#username# wrote:\r\n\r\n#message#\r\n\r\nYou can view and reply to the ticket at any time at #link#', '', 1);
INSERT INTO `faqs` (`id`, `question`, `tags`, `answer`, `category_id`, `product_id`, `news_id`, `lang_id`) VALUES
(1, 'What is Bitders.com?', '', 'Bitders.com is an international investment company based in England, UK.', 3, 0, 0, 1),
(2, 'Does [site_name] have any liability to the investor?', '', 'Yes, the company is under the government regulator Companies House.', 3, 0, 0, 1),
(3, 'Can users register before 18?', '', 'No, Services are Provided to adults only', 3, 0, 0, 1),
(4, 'Do you have a business license?', '', 'Yes, the company has permission from Companies House, For More information can be found on the government website of the UK Registration Chamber', 3, 0, 0, 1),
(5, 'Minimum and maximum investment?', '', 'An Investment can be any amount from 1 USD to 100 USD', 4, 0, 0, 1),
(6, 'Is it possible to register without a sponsor?', '', 'Yes, You can register without a Sponsor.', 5, 0, 0, 1),
(7, 'How much does it cost to open an account?', '', 'Opening an account with us is absolutely free. We do not charge you any hidden fees or service charges. The commission on operations and additional costs is included in the company&#039;s profit from crypto trading.', 3, 0, 0, 1),
(8, 'How long does it take to process a request for withdrawal of funds?', '', 'Applications for withdrawal of funds will be processed instantly.', 6, 0, 0, 1),
(9, 'Can I make several Investments at the same time?', '', 'Yes, you can have an unlimited number of deposits and unlimited investments in one account, but each of them will work independently of each other.', 4, 0, 0, 1),
(10, 'If I become your representative, what benefits do I get?', '', 'After assigning the representative status you can advise novice investors who need additional information about cooperation with the company. After helping you become their upline, and they become your referrals if they use your affiliate link for registration. To motivate you to provide high-quality consulting services, we pay a higher affiliate commission of first tier. It amounts to 15% instead of regular 10%.', 5, 0, 0, 1),
(11, 'I made a deposit from my cryptocurrency wallet, but it still isn&#039;t credited to my account. Why?', '', 'Because you must always wait until 2 confirmations before it&#039;s credited to your account, and it only depends on the speed of the Bitcoin network. These links are very useful for you: https://www.blockchain.com/btc/tx and https://www.blockchain.com/btc/unconfirmed-transactions.', 4, 0, 0, 1),
(44, 'What&#039;s the withdraw Time', '', 'Withdrawals are instant.', 6, 0, 0, 1),
(71, 'Which Payment Methods do you accept?', '', 'We accept All crypto currencies and EPaycore.', 4, 0, 0, 1);
